Standard Java programs use System.out. or System.err. followed by println, print, or printf for output: System.out.println("Regular output.");
System.err.println("Error message."); We use IO.println and IO.print for output: IO.println("Regular output.");
IO.println("Error message."); To finish converting the earlier Hello World example: void main() { IO.println("Hello World");
}

